import { Route } from 'react-router-dom';
import './App.css'
import HeaderComponent from './components/HeaderComponent/HeaderComponent'

function App() {
  return ( 
    <Route exact path="/">
    <div className="App">
      <header>
        <HeaderComponent/>
      </header>
      <main>
        <h2>main</h2>
      </main>
      <footer>
        <h3>footer</h3>
      </footer>
    </div>
    </Route>
  );
}

export default App;
